import React, { Component } from 'react';

class PageRenderer extends Component {
    constructor(props) {
        super(props);

        this.state = {
            currentPage: 'home'
        };
    }

    setCurrentPage = (pageName) => {
        this.setState({ currentPage: pageName });
    }

    render() {
        return (
            <div>
                Current Page: { this.state.currentPage }
            </div>
        );
    }
};

export default PageRenderer;
